def return_binary_or_hexa(tuple_int):
    a = tuple_int[3]
    b = tuple_int[9]

    missing_numbers = set(range(a+1, b)) - set(tuple_int[3:10])
    sum_missing = sum(missing_numbers)

    if sum_missing == 0:
        return ""
    elif sum_missing % 2 == 1:
        return bin(sum_missing)[2:]
    else:
        return hex(sum_missing)[2:].upper()
